import React from 'react';
import sdata from "./Sdata.jsx";
import Card from "./Card.jsx";

const Netflix = () => {
    return (

        <Card 
        key={sdata[0].id}
            src={sdata[0].src}
            title={sdata[0].title}
            details={sdata[0].details}
        
        />
     
    );
};

export default Netflix;
